It's brightest stars form an asterism known as teapot. This constellation is associated with many famous deep sky objects like Saggitarius Dwarf elliptical Galaxy, Barnard's Galaxy, Saggitarius Dwarf irregular Galaxy and Bubble nebula. It is associated to about 15 messier objects out of which M24, M17, M18, M8 & M20 are very prominent. Others include M21, M22, M23, M25, M28, M54, M55, M69, M70 & M75. Pistol star, one of the most luminous stars is also associated with this constellation. Saggitarius A is a radio source located in center of milky way, in direction of this constellation. It's stars represent Purva ashadha and Uttara ashadha nakshatra.

